GO
-- =============================================
-- Author:		<Author,,Name>
-- Create date: <Create Date, ,>
-- Description:	<Description, ,>
-- =============================================
CREATE FUNCTION [dbo].[getIDDetailResep] --select dbo.getIDDokter()
(
)
RETURNS varchar(20)
AS
BEGIN
	DECLARE @cek int,@nomor_baru varchar(7),@nomor_lama varchar(7)

	
	SELECT top 1 @nomor_lama=cast (right(id_detail_resep,4) as int)+1 from TBL_DETAIL_RESEP order by ID_DETAIL_RESEP desc
	if @nomor_lama is null
	begin
	set @nomor_baru='1'
	end
	else 
	begin
	set @nomor_baru=' '+right(''+''+@nomor_lama,4)
	end

	RETURN @nomor_baru

END

GO

